    false,nt"url": null,nt"notes": "This narrative report for Crescent Lake
    National Wildlife Refuge outlines Refuge accomplishments from May through July of
    1941. The report begins by summarizing the weather conditions and food and cover
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, predators, fish, reptiles, and disease- is also covered. The Refuge
    development and maintenance section discusses physical developments and wildfires.
    Resource management is outlined; topics include grazing and haying. The public relations
    section of the report describes recreational uses and Refuge visitors. A short narrative
    on the North Platte Refuge is included. Photographs are attached.",nt"license_title":
